import React from 'react';
import {Cards} from './menuItem.js';
import './component.css'

function Card(){
    return(
        <div className="card">
            {Cards.map((item, index) => {
                return(
                <div className="product_card" key={index}>
                <img src={item.img} alt="" />
                <div className="product_box">
                    <h5>{item.head}</h5>
                    <span>{item.detail}</span>
                </div>
                </div>
                )
            })}
        </div>
    )
}
export default Card;
